  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:26.069036\",\n\t\"name\": \"report-on-oregon-spotted-frog-egg-mass-surveys-2013-2015\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Oregon spotted frogs (Rana pretiosa) were
  once common across wetlands throughout western Washington and Oregon and were found
  in northern California and southern British Columbia. It is believed that they are
  now present in less than 20% of their historic range (Hayes 1997), and many of the
  remaining populations have dwindled to very low numbers. As a result of rapidly
  declining populations, Oregon spotted frogs were Federally listed as Threatened
  under the US Endangered Species Act in August 2014 (USFWS 2014). They have been
  listed as Endangered by the State of Washington since 1997 (WDFW 2011).One of the
  main challenges for Oregon spotted frogs range-wide is the loss and degradation
  of the large wetland complexes that are their preferred habitat (McAllister et al.
  1993; Hayes 1994a, b; Hayes 1997). Other things that may harm Oregon spotted frogs
  include invasive plants like reed canary-grass (Phalaris arundinacea) (Kapust et
  al. 2012); introduced predators such as American bullfrogs (Lithobates catesbeianus)
  and warm water fishes (Hayes & Jennings 1986, Adams et al. 2003); removal of natural
  disturbance regimes including fires, floods, and beavers that historically maintained
  open wetlands (Watson et al. 2003); and changes to the natural hydrologic cycle
  as a result of dams, climate change, or wetland alterations (Adams 1999).\",\n\t\"license_title\":
